import * as React from 'react';
import {
  Grid,
  Typography,
  Card,
  CardHeader,
  CardContent,
  Divider,
} from '@material-ui/core';
import useTranslations from '../../hooks/useTranslations';

import useStyles from './style';

const Property: React.FunctionComponent = () => {
  const classes = useStyles();
  const { t } = useTranslations();

  return (
    <div className={classes.root}>
      <Grid container spacing={4}>
        <Grid item xs={12} sm={6}>
          <Typography variant="body1">{t('administration')}</Typography>
          <Typography variant="h6">Gebäude & Räume</Typography>
        </Grid>
      </Grid>
      <Grid container spacing={4}>
        <Grid item xs={12} sm={6}>
          <Grid container>
            <Grid item xs={12} sm={6}>
              <Card>
                <CardHeader>
                  <Typography variant="h5">Gebäude 1</Typography>
                </CardHeader>
                <Divider />
                <CardContent>
                  <Typography variant="body1">Beschreibung</Typography>
                </CardContent>
              </Card>
            </Grid>
          </Grid>
        </Grid>
      </Grid>
    </div>
  );
};

export default Property;
